import { useState, useEffect } from "react";
import axios from "axios";
import "./Profile.css";
import MyRecipes from "./MyRecipe";
import SavedRecipe from "./SavedRecipe";
import { CSSTransition } from "react-transition-group";

function Profile() {
const [data, setUserData] = useState([]);
const [followingNum, setFollowingnum] = useState("");
const [followersNum, setFollowersNUm] = useState("");
const [showMyRecipes, setShowMyRecipes] = useState(true);
const [showPopup, setShowPopup] = useState(false);

useEffect(() => {
const fetchUserProfile = async () => {
const userId = localStorage.getItem("id");
const response = await axios.get(`http://localhost:1112/user/${userId}`);

  setUserData(response.data);
  setFollowingnum(response.data.following.length);
  setFollowersNUm(response.data.followers.length);
};

fetchUserProfile();
}, []);

const handlefollowingClick = () => {
setShowPopup(true);
};

const handlefollowersClick = () => {
setShowPopup(false);
};

const renderUsernames = (userIds) => {
return userIds.map(async (userId) => {
const response = await axios.get(`http://localhost:1112/user/name/${userId}`);
return response.data.name;
});
}

const renderFollowingNames = async () => {
const followingNames = await Promise.all(renderUsernames(data.following));
return followingNames.join(", ");
};

const renderFollowerNames = async () => {
const followerNames = await Promise.all(renderUsernames(data.followers));
return followerNames.join(", ");
};

return (
<section className="ProfilePage">
<header className="ProfileHeader">
<div className="ProfileHeaderImageName">
<img
src={data.profilePic}
className="ProfilePicture"
alt="ProfilePic"
/>
<div className="NameFollowingFollowersHeader">
<h1>{data.name}</h1>
<div className="FollowingFollowersHeader">
<div onClick={() => handlefollowingClick()}>
<h2 className="FollowingFollowers">Following:</h2>
<b>{followingNum}</b>
<div className="FollowingNames">{showPopup ?  renderFollowingNames() : null}</div>
</div>
<div onClick={() => handlefollowersClick()}>
<h2 className="FollowingFollowers">Followers:</h2>
<b>{followersNum}</b>
<div className="FollowingNames">{!showPopup ?  renderFollowerNames() : null}</div>
</div>
</div>
</div>
</div>

    <div className="ProfileHeaderButtons">
      <button>Edit Profile</button>
      <button>Add Recipe</button>
      <button>Settings</button>
    </div>
  </header>
  <nav className="ProfileNavigator">
    <a onClick={() => setShowMyRecipes(true)}>Recipes</a>
    <a onClick={() => setShowMyRecipes(false)}>Saved</a>
  </nav>
  {showMyRecipes ? <MyRecipes /> : <SavedRecipe />}
  <CSSTransition
    in={showPopup}
    timeout={300}
    classNames="ProfilePopup"
    unmountOnExit
  >
    <div className="ProfilePopup"></div>
  </CSSTransition>
</section>
);
}

export default Profile;
